            "id": 125035,
            "name": "Chickasaw County Daily Phonebank",
            "van_name": "R05I_Phonebank_Chickasaw County Daily Phonebank",
            "tagline": "Dream big, fight hard.",
            "description": "Join us for a phone bank in Chickasaw or make calls from home to talk with people in your area about the big, structural change that Elizabeth is fighting for in Iowa. Bring a cell phone if you have one. \n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Tess Bloch know by emailing tbloch@elizabethwarren.com or calling/texting 914-275-2625 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there! Thanks for being a part of this fight.",
