            "id": 129481,
            "name": "Pocahontas Daily Canvass!",
            "van_name": "R02E_Canvass_Pocahontas_Daily Canvass",
            "tagline": "Dream big, fight hard.",
            "description": "Join us for a canvass in Pocahontas any day of the week to talk with your neighbors about the big, structural change that Elizabeth is fighting for in Iowa. \n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Callie Grow know by emailing cgrow@elizabethwarren.com or calling/texting (615) 943-2436 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there! Thanks for being a part of this fight.",
            "description_html": "<p>Join us for a canvass in Pocahontas any day of the week to talk with your neighbors about the big, structural change that Elizabeth is fighting for in Iowa. </p>\n<p>Our team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.</p>\n<p>If you have any accessibility needs, please let Callie Grow know by emailing cgrow@elizabethwarren.com or calling/texting (615) 943-2436 so that we can make sure the event will be accessible and comfortable for you.</p>\n<p>We’ll see you there! Thanks for being a part of this fight.</p>",
