            "name": "Palo Alto Daily Phonebank!",
            "van_name": "R02E_Phonebank_PaloAlto_Daily PB",
            "tagline": "Dream big, fight hard.",
            "description": "Join us for a phonebank in Palo Alto County any day of the week to talk with people in your area about the big, structural change that Elizabeth is fighting for in Iowa. Bring a cell phone if you have one. \n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Callie Grow know by emailing cgrow@elizabethwarren.com or calling/texting (615) 943-2436 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there! Thanks for being a part of this fight.",
