            "id": 147318,
            "name": "Burlington Daily Phone Bank",
            "van_name": "R08c_Burlington_PhoneBank_Daily",
            "tagline": "Dream Big, Fight Hard",
            "description": "Join us for a phone bank in Burlington to talk with people in your area about the big, structural change that Elizabeth is fighting for in Iowa. Bring a cell phone if you have one. \n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Alyssa know by emailing agilbert@elizabethwarren.com or calling/texting 541-678-3905 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there! Thanks for being a part of this fight.",
            "description_html": "<p>Join us for a phone bank in Burlington to talk with people in your area about the big, structural change that Elizabeth is fighting for in Iowa. Bring a cell phone if you have one. </p>\n<p>Our team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.</p>\n<p>If you have any accessibility needs, please let Alyssa know by emailing agilbert@elizabethwarren.com or calling/texting 541-678-3905 so that we can make sure the event will be accessible and comfortable for you.</p>\n<p>We’ll see you there! Thanks for being a part of this fight.</p>",
